const LastName = createContext();


const App1 = () => {
    return (
        <>
            <FirstName.Provider value={'raj'}>
                <LastName.Provider vlaue={"singh"}>
                    <ComA />
                </LastName.Provider>
            </FirstName.Provider>
        
             
            </>
    );
};
export default App1;
export { FirstName };
